import React from 'react';

export default function Map() {
    return (
        <div className="Map">
            <iframe
                width="600"
                height="450"
                // style="border:0"
                loading="lazy"
                allowfullscreen
                referrerpolicy="no-referrer-when-downgrade"
                title="Google Maps"
                src="https://www.google.com/maps/embed/v1/place?key=AIzaSyCnasDuC3M7MHKCLlxqXU3vyJnzKAnwBTw&q=Space+Needle,Seattle+WA">
            </iframe>
        </div>
    )
}
